import React from "react";
import { Link } from "react-router-dom";

export class CartData extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
  }

  componentDidMount() {
      const url = "/carts/last";
      fetch(url)
        .then(response => {
          if (response.ok) {
            return response.json();
          }
          throw new Error("Network response was not ok.");
        })
        .then(data => this.setState({ data: data }))
        .catch(() => this.props.history.push("/"));
  };


  render() {
    const { data } = this.state;
    // console.log(data);
    const allData = data.map((data, index) => (
      <tr key={ index }>
        <td>{data.quantity}</td>
        <td>{data.product_id}</td>
        <td className="item_price" >price</td>
      </tr>
    ));

    const noData = (
      <div className="">
        <h4>
          Empty Cart
        </h4>
      </div>
    );

    return (
      <>
        <table className="nav-cart">
          <thead>
            <tr>
              <th colSpan="2">Your Cart</th>
            </tr>
          </thead>
          <tbody>
          { allData }
          <tr className="total_line">
            <td>Total</td>
            <td>$xxxx</td>
          </tr>
          <tr>
            <td colSpan="2"><button>Empty Cart</button></td>
          </tr>
          </tbody>
        </table>
      </>
    );
  }

}
